import './Footer.css';
function Footer(props) {
    console.log(props);
    return (
        <div id="footer">
            <div id="contact">
                <div>
                    <h4> Contact: </h4>
                </div>
                <div id="reseaux">
                    <p> Mail:</p>
                    <p> Téléphone:</p>
                    <p> Instagram:</p>
                </div>
            </div>
            <div id="autre">
                <p> Nigloland
                    D619, 10200 Dolancourt
                </p>
                <p>Tél : 03 25 27 94 52 </p>
            </div>
        </div>
    );
}
export default Footer;
